    const parameter = useParams()
    const [flight, setFlight] = useState()

	// Get Airports from flight microservice
	handleAxiosGet = () => {
		axios.get("http://localhost:8082/v1/all-flights")
			.then(
				res => {
					console.log(res.data)
				}
			)
	}


  return (
    <div>
        {parameter.id}
    </div>
  )
}
